import React from 'react';
import './RecipeList.css';

export default function RecipeList({ recipes }) {
  return (
    <div className='recipe-list'>
      {recipes.map((recipe) => (
        <h3 key={recipe.id} className='card'>
          {recipe.title}
        </h3>
      ))}
    </div>
  );
}
